import { Navbar, Nav, FormControl, Button } from "react-bootstrap";

function Navibar() {
  return (
    <Navbar bg="light" variant="light">
      <div className="logo">
        <div className="red-circle"></div>
      </div>
      <FormControl
        type="text"
        placeholder="Search"
        className="mr-sm-2 long-searchbar"
      />
      <Nav className="ml-auto">
        <Nav.Link href="#">Menu Item 1</Nav.Link>
        <Nav.Link href="#">Menu Item 2</Nav.Link>
      </Nav>
    </Navbar>
  );
}

export default Navibar;
